import React from "react";
import Header from "../Components/Header";
import Navbar from "../Components/Navbar";

function Home() {
  return (
    <div className="bg-black h-full">
      <div className="">
        <Header />
      </div>
      <div className=" grid grid-rows-2 gap-4 grid-cols-12">
        <div className="col-span-3">
          <Navbar />
        </div>
      </div>
    </div>
  );
}

export default Home;
